import "./Home.css";

import Box from "@material-ui/core/Box";
//import Button from "@material-ui/core/Button";
import Container from "@material-ui/core/Container";
import Content from "../BaseLayout/Content/Content";
//import DashboardCard from "../Elements/Cards/DashboardCard";
//import DevicesIcon from "@material-ui/icons/Devices";
import Grid from "@material-ui/core/Grid";
//import KeyboardArrowDownIcon from "@material-ui/icons/KeyboardArrowDown";
import Link from "@material-ui/core/Link";
//import LiveHelpIcon from "@material-ui/icons/LiveHelp";
//import PermIdentityIcon from "@material-ui/icons/PermIdentity";
//import QuestionAnswerIcon from "@material-ui/icons/QuestionAnswer";
import React from "react";
import Title from "../BaseLayout/Content/Title";
import Typography from "@material-ui/core/Typography";
import Header from "../BaseLayout/Header/Header";

const Home = () => {
  return (
    <Content>
      <Header disableExpanded={true} />
      <Title>
        <Box component="div" m={1}>
          <Typography variant="h3" className="primary-company-color" gutterBottom>
            Bienvenido a
            <img
              width="150"
              src={process.env.PUBLIC_URL + "/assets/images/logo-inverse.png"}
              alt="Logo"
              style={{
                verticalAlign: "middle",
              }}
            />
          </Typography>
        </Box>
      </Title>
      <Container maxWidth="md">
        <Box component="span" m={1}>
          <Typography variant="subtitle1" gutterBottom>
            Éste proyecto fue desarrollado en Javascript y React usando el framework Material-ui, puedes
            encontrar la documentación de los componentes en el siguiente enlace:
          </Typography>
        </Box>
        <Grid container spacing={4} justify="center">
          <Grid item>
            <Link
              href="https://v4.mui.com/getting-started/installation/"
              target="_blank"
                        rel="noopener noreferrer"
            >
              Material-ui
            </Link>
          </Grid>
        </Grid>
      </Container>
    </Content>
  );
};

export default Home;
